			@keyframes rota {
			    0% {transform: rotate(0deg);}
			    25% {transform: rotate(20deg);}
			    50% {transform: rotate(0deg);}
			    75% {transform: rotate(-5deg);}
			    100% {transform: rotate(0deg);}
			}

			@keyframes reveal {
				0%{opacity: 1;}
				25%{opacity:1;}
				30%{opacity:0;}
				95%{opacity:0;}
				100%{opacity:1;}
			}

			@keyframes pokemon {
				0%{opacity: 0;}
				25%{opacity:0;}
				30%{opacity:1;}
				95%{opacity:1}
				100%{opacity:0;}
			}

			#secret_Pichu{
				opacity: 1;
				transition: opacity 1s;
				transform-origin: center center;
				animation: reveal 12s infinite;
			}
			#pichu{
				opacity:0;
				transform-origin: center center;
				animation: pokemon 12s infinite, rota 1s ease-in-out infinite;
			}
			
			#question_mark{
				opacity:1;
				transition: opacity 1s;
				animation: reveal 12s infinite;
			}
			.header {
				text-align: center;
